(1, 'Mayja', '2018-10-18 00:00:00', 'Feminino', 'Não Castrado', 'O', '60', '25', 'Health4Pet', '2012-05-21', 2, 'Olhos castanhos, pelagem castanha avermelhada, mancha branca no peito, unhas pretas e brancas, coxins marrons, boa forma física.', 'Agitada e carinhosa, adora correr e ficar no colo, não tem o costume de correr e se dá bem tanto com outros animais quanto com humanos, nunca reclama em consultas.', NULL, , 'Canino', 'Boxer', '2019-05-30 17:06:30', 'Pet Total');
INSERT INTO `animais` (`id_animal`, `nome_animal`, `created_at`, `sexo_animal`, `cast_animal`, `sang_animal`, `alt_animal`, `peso_animal`, `conv_animal`, `nasc_animal`, `id_cli`, `apar_animal`, `pers_animal`, `compri_animal`, `img_animal`, `tipo_animal`, `raca_animal`, `updated_at`, `planoconv_animal`) VALUES
(7, 'Lyra', '2019-05-30 16:07:20', 'Feminino', 'Não Castrado', 'A', '23', '2', 'Health4Pet', '2019-01-16', 18, 'Olhos verdes oliva, pelagem tricolor (branca, preta e laranja), focinho bicolor, discretos pontos pretos na parte branca da pelagem, coxins pretos e rosas, boa forma física.', 'Agitada e carente, apesar de não gostar de ser pega ou de receber carinho gosta menos ainda de ficar sozinha, é muito ativa, gosta muito de correr e não gosta de dormir, não costuma se dar bem com outros animais por ser territorial e ciumenta, não se importa com sons altos, reclama bastante em consultas.', NULL, , 'Felino', 'Raça indefinida', '2019-05-30 16:07:20', 'Pet Total');
INSERT INTO `animais` (`id_animal`, `nome_animal`, `created_at`, `sexo_animal`, `cast_animal`, `sang_animal`, `alt_animal`, `peso_animal`, `conv_animal`, `nasc_animal`, `id_cli`, `apar_animal`, `pers_animal`, `compri_animal`, `img_animal`, `tipo_animal`, `raca_animal`, `updated_at`, `planoconv_animal`) VALUES
(8, 'Arya', '2019-05-30 16:13:08', 'Feminino', 'Castrado', 'AB', NULL, '2.2', 'Health4Pet', '2018-12-26', 18, 'Olhos verdes, pelagem preta, coxins pretos, boa forma física.', 'Calma e carinhosa, não se importa de ser pega no colo, gosta muito de escalar e dormir, não costuma se dar bem com cachorros, entra em pânico ao ouvir sons muito altos, não costuma reclamar em consultas.', NULL, , 'Felino', 'Raça indefinida', '2019-05-30 16:14:50', 'Pet Total');
INSERT INTO `animais` (`id_animal`, `nome_animal`, `created_at`, `sexo_animal`, `cast_animal`, `sang_animal`, `alt_animal`, `peso_animal`, `conv_animal`, `nasc_animal`, `id_cli`, `apar_animal`, `pers_animal`, `compri_animal`, `img_animal`, `tipo_animal`, `raca_animal`, `updated_at`, `planoconv_animal`) VALUES
(9, 'Anubis', '2019-05-30 16:24:34', 'Masculino', 'Castrado(a)', 'DEA 1.1', '40', '3', NULL, '2019-07-02', 17, 'Olhos castanhos, pelagem preta, com patas e cabeça champagne, focinho preto, unhas pretas, coxins pretos, acima do peso.', 'Brincalhão e preguiçoso, gosta muito de ficar no colo e de brincar, apesar de não ter muita disposição e cansar rápido, não gosta de andar mas gosta de passear sendo carregado, se dá muito bem com humanos mas com cachorros pode ser imprevisível (gosta de alguns mas parte para cima de outros), nunca teve contato com gatos.', NULL, , 'Canino', 'Yorkshire', '2019-07-02 00:01:42', NULL);
INSERT INTO `animais` (`id_animal`, `nome_animal`, `created_at`, `sexo_animal`, `cast_animal`, `sang_animal`, `alt_animal`, `peso_animal`, `conv_animal`, `nasc_animal`, `id_cli`, `apar_animal`, `pers_animal`, `compri_animal`, `img_animal`, `tipo_animal`, `raca_animal`, `updated_at`, `planoconv_animal`) VALUES
