INSERT INTO `animais` (`id_animal`, `nome_animal`, `created_at`, `sexo_animal`, `cast_animal`, `sang_animal`, `alt_animal`, `peso_animal`, `conv_animal`, `nasc_animal`, `id_cli`, `apar_animal`, `pers_animal`, `compri_animal`, `img_animal`, `tipo_animal`, `raca_animal`, `updated_at`, `planoconv_animal`) VALUES
(12, 'Ooflord', '2019-07-01 22:39:44', 'Masculino', 'Não castrado(a)', 'DEA 4', '33', '15', NULL, '2019-07-02', 19, 'Um Shiba Inu saudável de estatura baixa, chegando a se parecer com um Mame Shiba Inu, sua calda enrola mais do que o normal para os Shibas', 'Leal e companheiro, enfrenta qualquer tarefa portanto que esteja perto de seu dono, porém quando se trata de brincadeiras e ele deixa a desejar.', NULL, , 'Canino', 'Shiba Inu', '2019-07-02 00:04:20', NULL);
