(7, 19, 11, 'Vacinação V4', '2019-07-01 23:43:41', 'Vacinação contra as quatro doenças principais dos felinos: Panleucopenia, Rinotraqueíte, Calicivirose, e Clamidiose.', NULL, 'Concluido', 30, '2019-09-11', 'Pago', 21, '2019-07-11', '09:30:00'),
