(9, 2, 12, 'Vacinação V8', '2019-07-01 23:55:06', 'Vacina que evita as seguintes doenças:\r\n\r\nCinomose: uma virose que pode provocar paralisia e até matar\r\n\r\nParvovirose: doença grave e potencialmente fatal que pode atacar o sistema gastrointestinal ou o coração do animal\r\n\r\nHepatite infecciosa: muito agressiva, ataca o fígado\r\nAdenovirose-2: que gera a gripe canina\r\n\r\nParainfluenza: muito contagiosa, provoca problemas respiratórios\r\n\r\nCoronavirose: infecção aguda conhecida como gastroenterite contagiosa canina\r\n\r\nDois tipos mais comuns de leptospirose (causados pelas cepas icterohaemorrhagiae e canicola): atinge gravemente os rins e o fígado. Pode facilmente ser transmitida para humanos', NULL, 'Concluido', 40, '2019-10-24', 'Pago', 21, '2019-07-22', '18:30:00'),
(10, 20, 13, 'Aparar os pelos', '2019-07-02 00:41:46', 'Aparar os pelos de acordo com a exigência da cliente.', NULL, 'Concluido', 25, '2019-07-12', 'Pendente', 26, '2019-07-21', '08:30:00'),
(11, 19, 12, 'Cortar as unhas', '2019-07-02 00:43:45', 'Cortas as unhas de acordo com a exigência do cliente, tendo cuidado para n causar danos.', NULL, 'Não concluido', 25, '2019-07-20', 'Pendente', 26, '2019-07-15', '15:15:00');

